import React, {useState, useMemo} from 'react';

const Table = ({data}) => {

	console.log("Table.js",data);

	const [id, title, completed] = data;

	return(
		<table className="table table-bordered">
		    <thead>
		      <tr>
		      	<th>id</th>
		        <th>Title</th>
		        <th>Completed</th>
		        <th>Action</th>
		      </tr>
		    </thead>
		    <tbody>
		    	<tr>
		    	<td>1</td>
		    	<td>ABC</td>
		    	<td>True</td>
		    	</tr>
		    </tbody>
		  </table>
	)
	
}

export default Table;
